import React from 'react';
import './App.css';
import { Route } from "react-router-dom";

import Main from './pages/main';

class App extends React.Component {

  constructor(props){
    super(props);
    this.state={};
  }
  
  render(){
    return (
      <div className="App">
        {/* 실제로 연결해볼까요! */}
        <Route path="/" component={Main} />
      </div>
    );
  }
}

export default App;
